import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import Spinner from "./Spinner";
import Alert from "./Alert";

const Transactions = ({ transactionType }) => {
  // State variables
  const [isLoading, setIsLoading] = useState(true);
  const [transactions, setTransactions] = useState([]);
  const [alertType, setAlertType] = useState(null);
  const [alertMessage, setAlertMessage] = useState("");

  // Fetch all payments/receipts
  useEffect(() => {
    const fetchTransactions = async () => {
      try {
        const response = await axios.get(
          `/transactions?type=${transactionType}`
        );

        if (response.status === 200) {
          if (response.data.length === 0) {
            setAlertType("warning");
            setAlertMessage(`No ${transactionType}s found.`);
          } else {
            setTransactions(response.data);
          }
        } else {
          setAlertType("danger");
          setAlertMessage(
            `Failed to retrieve ${transactionType}s: ${response.status} ${response.statusText}`
          );
        }
        setIsLoading(false);
      } catch (error) {
        setAlertType("danger");
        setAlertMessage(
          `Failed to retrieve ${transactionType}s: ${error.message}`
        );
        setIsLoading(false);
      }
    };

    fetchTransactions();
  }, [transactionType]);

  // Map transaction type code to readable names
  const getTransactionTypeName = (type) => {
    const types = {
      BPV: "Bank Payment Voucher",
      CPV: "Cash Payment Voucher",
      BRV: "Bank Receipt Voucher",
      CRV: "Cash Receipt Voucher",
    };
    return types[type] || "Unknown";
  };

  return (
    <div className="container mt-5">
      {/* Alert Message */}
      {alertMessage && <Alert type={alertType} message={alertMessage} />}

      {/* Loading Spinner */}
      {isLoading ? (
        <Spinner />
      ) : (
        <div className="card shadow-lg border-0">
          <div className="card-header bg-gradient-primary text-white">
            <h3 className="text-center mb-0">
              {transactionType === "payment" ? "Payments" : "Receipts"}
            </h3>
          </div>

          <div className="card-body">
            <div className="d-flex justify-content-between mb-3">
              <h5 className="mb-0">
                {transactionType === "payment"
                  ? "List of Payments"
                  : "List of Receipts"}
              </h5>
              <Link to="add" className="btn btn-success">
                <i className="fa fa-plus"></i> Add{" "}
                {transactionType === "payment" ? "Payment" : "Receipt"}
              </Link>
            </div>

            {/* Table Content */}
            {transactions.length === 0 ? (
              <Alert
                type="warning"
                message={`No ${transactionType}s available at the moment.`}
              />
            ) : (
              <div className="table-responsive">
                <table className="table table-striped table-hover align-middle">
                  <thead className="table-primary">
                    <tr>
                      <th>Voucher No.</th>
                      <th>Date</th>
                      <th>Type</th>
                      <th>
                        {transactionType === "payment"
                          ? "Payment To"
                          : "Receipt From"}
                      </th>
                      <th>Amount</th>
                    </tr>
                  </thead>
                  <tbody>
                    {transactions.map((transaction) => (
                      <tr key={transaction.transaction._id}>
                        <td>{transaction.transaction.voucherNo}</td>
                        <td>{transaction.transaction.date}</td>
                        <td>
                          {getTransactionTypeName(transaction.transaction.type)}
                        </td>
                        <td>
                          {transaction.partner
                            ? `${transaction.partner.firstName} ${transaction.partner.lastName}`
                            : "Unknown Partner"}
                        </td>
                        <td>
                          ${" "}
                          {parseFloat(
                            transaction.transaction.amount
                          ).toLocaleString()}
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        </div>
      )}
    </div>
  );
};

export default Transactions;
